package t20230419.study;
// for, while, do while 비교
public class testtest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (int a = 3; a <= 3; a++) {
			System.out.println(a);
		}
		System.out.println();
		int b = 3;
		while (b <= 3) {
			System.out.println(b);
			b++;
		}
		System.out.println();
		int c = 3;
		do {System.out.println(c);
		c++;
		} while (c <= 3);
	
	}

}
